bool _sign[9],vis[1681*1681];
inline void calc(vector<int>&s,int&x,int&y) {
    x=0;
    y=0;
    for(int i=0; i<8; i++) {
        if(i<4)x=(x*10+s[i]);
        else y=(y*10+s[i]);
    }
    x=mp[x];
    y=mp[y];
    return;
}
vector<int>qwerty;
int bfs(vector<int>s) {
    if(s==qwerty)return 0;
    memset(vis,0,sizeof(vis));
    queue<vector<int> >q;
    queue<int>qd;
    vector<int>a;
    int x,y;
    calc(s,x,y);
    x=x*1680+y;
    vis[x]=1;
    q.push(s);
    qd.push(0);
    while(!q.empty()) {
        s=q.front();
        q.pop();
//        for(int i=0;i<8;i++)cout<<s[i]<<" ";cout<<endl;
        for(int i=0; i<8; i++) {
            for(int j=i+1; j<8; j++) {
                //cout<<i<<" "<<j<<" "<<_sign[s[i]-'0']<<" "<<_sign[s[j]-'0']<<" "<<(s[i]-'0'+s[j]-'0'+2)<<" "<<isP[(s[i]-'0'+s[j]-'0'+2)]<<endl;
                if((_sign[s[i]]^_sign[s[j]]) && (isP[s[i]+s[j]+2])) {
                    a.clear();
                    for(int k=0; k<i; k++) {
                        a.push_back(s[k]);
                    }
                    for(int k=i+1; k<j; k++) {
                        a.push_back(s[k]);
                    }
                    a.push_back(s[i]);
                    a.push_back(s[j]);
                    for(int k=j+1; k<8; k++) {
                        a.push_back(s[k]);
                    }
                    calc(a,x,y);
                    x=x*1680+y;
//                    cout<<d<<endl;
                    if(!vis[x]) {
                        vis[x]=1;
                        q.push(a);
                        qd.push(qd.front()+1);
                    }
                    if(x==(mp[123]*1680+mp[4567]))return qd.front()+1;
                    a.clear();
                    for(int k=0; k<i; k++) {
                        a.push_back(s[k]);
                    }
                    for(int k=i+1; k<j; k++) {
                        a.push_back(s[k]);
                    }
                    a.push_back(s[j]);
                    a.push_back(s[i]);
                    for(int k=j+1; k<8; k++) {
                        a.push_back(s[k]);
                    }
                    calc(a,x,y);
                    x=x*1680+y;
//                    cout<<d<<endl;
                    if(!vis[x]) {
                        vis[x]=1;
                        q.push(a);
                        qd.push(qd.front()+1);
                    }
                    if(x==(mp[123]*1680+mp[4567]))return qd.front()+1;
                    a.clear();
                    for(int k=0; k<i; k++) {
                        a.push_back(s[k]);
                    }
                    a.push_back(s[i]);
                    a.push_back(s[j]);
                    for(int k=i+1; k<j; k++) {
                        a.push_back(s[k]);
                    }
                    for(int k=j+1; k<8; k++) {
                        a.push_back(s[k]);
                    }
                    calc(a,x,y);
                    x=x*1680+y;
//                    cout<<d<<endl;
                    if(!vis[x]) {
                        vis[x]=1;
                        q.push(a);
                        qd.push(qd.front()+1);
                    }
                    if(x==(mp[123]*1680+mp[4567]))return qd.front()+1;
                    a.clear();
                    for(int k=0; k<i; k++) {
                        a.push_back(s[k]);
                    }
                    a.push_back(s[j]);
                    a.push_back(s[i]);
                    for(int k=i+1; k<j; k++) {
                        a.push_back(s[k]);
                    }
                    for(int k=j+1; k<8; k++) {
                        a.push_back(s[k]);
                    }
                    calc(a,x,y);
                    x=x*1680+y;
//                    cout<<d<<endl;
                    if(!vis[x]) {
                        vis[x]=1;
                        q.push(a);
                        qd.push(qd.front()+1);
                    }
                    if(x==(mp[123]*1680+mp[4567]))return qd.front()+1;
                }
            }
        }
        qd.pop();
    }
    return -1;
}
